import React, {useEffect, useState} from 'react';
import './mdb/mdb.min.css';
import './styles.css';
import Header from './components/Header';

// rfce for new React Component template
// firebase deploy for new deployment

function App() {

  const [items, setItems] = useState([{}]);

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      items => {
        setItems(items)
      }
    )
  }, []);

  return (
    <section>
      <Header />
      <switch>

      </switch>
    </section>
  );
}

export default App;
